import React, { Component } from 'react'
import { View, Text } from 'react-native'

export class AlbumList extends Component {
    constructor(props){
        super(props)
        this.state = {
            albuns: [],
        }
    }

    componentDidMount(){
        fetch("https://raw.githubsercontent.com/san650/ten/master/apps/music/api/albums.json")
        .then(
            (response)=>response.json()
        )
        .then(
            (responseJson)=>{
                 this.setState({
                    albuns: responseJson.albums
                 })
         })
    }

    render() {
        return (
            <View>
                <Text>
                    Galeria
                </Text>
            </View>
        )
    }
}

export default AlbumList
